    const [modalisOpen, setmodalisOpen] = useState(false);

    function deleteHandler(){
        setmodalisOpen(true);
    }

    function removeModal(){
        setmodalisOpen(false);
    }

    return (
        <div>
            <strong onClick={deleteHandler}>
                
                    <u>
                        Login
                    </u>
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQj6oAcgtwpM42Mxvd9kKWSKiIaPTzZ225cvg&usqp=CAU" />
                
            </strong>
        </div>
    );
}
 
export default LoginLink;
